import "./Service.css";
import React from "react";
import { Link } from "react-router-dom";

export default function Service() {
    return (
        <section className="container-three">
            <h1>Service</h1>
            <Link to="/user"></Link>
            <button className="userlink">Click</button>
        </section>
    );
}
